import React from 'react'
import './blog.css'
import { useSelector } from 'react-redux'

function Blog() {

    const blogMainImg = useSelector(state => state.menuBar.blogMainImg)
    const blogPhoneMainImg = useSelector(state => state.menuBar.blogPhoneMainImg)
    const svgDoodleWhite = useSelector(state => state.menuBar.svgDoodleWhite)
    const svgDoodleBlack = useSelector(state => state.menuBar.svgDoodleBlack)
    const colorOfBody = useSelector(state => state.menuBar.colorOfBody)
    const svgContent = colorOfBody === 'light-theme' ? svgDoodleBlack : svgDoodleWhite;


  return (
    <div>
        <section className='main-infoBlog'>
            <div className='infoBlog-image'>
                <div className='imageInfo-container'>
                    <img src={blogMainImg} alt="img" />
                </div>

            </div>
            <div className='infoBlog-content'></div>
        </section>
    </div>
  )
}

export default Blog
